// обаботчики нажатий на клавиши
window.onkeydown = function(){
	// statusMenu
        if(event.keyCode==73){
      showHideStatusMenu();
    }	

        if(event.keyCode==27){
      showHideAsideMenu();
    }

    if(inTeleportation==0){

      // flashLight
        if(event.keyCode==70){
      toggleFlashLight();
    }

        // shift
        if(event.keyCode==16){
      playerLeftXDistance=-10;
      playerRightXDistance=10;
      playerUpYDistance=10;
      playerDownYDistance=-10;
    }

  // left
        if(event.keyCode==65){
          figure.style.backgroundImage='url(' + figureLeftImg + ')';
          leftInMove=1;
          flagStayLeft=0;
	      flagStayRight=0;
          if(flagLeft==0){ 
		     flagLeft=1;
		     flagRight=0;
		     rightInMove=0;
		     flagDown=0;
		     downInMove=0;
		     flagUp=0;
		     upInMove=0;
		    try{
		      clearInterval(timerRight);
		      clearInterval(timerUp);
		      clearInterval(timerDown);
		    }
		    catch{}
		     timerLeft = setInterval(playerMoveLeft,50);
      	}
}
  // right
    else if(event.keyCode==68){
      figure.style.backgroundImage='url(' + figureRightImg + ')';
      rightInMove=1;
      flagStayLeft=0;
	  flagStayRight=0;
      if(flagRight==0){
	      flagRight=1;
	      flagLeft=0;
	      leftInMove=0;
	      flagDown=0;
	      downInMove=0;
	      flagUp=0;
	      upInMove=0;
	    try{
	      clearInterval(timerLeft);
	      clearInterval(timerUp);
	      clearInterval(timerDown);
	    }
	    catch{}
	      timerRight = setInterval(playerMoveRight,50);
    }
}

   // up
    else if(event.keyCode==87){
    figure.style.backgroundImage='url(' + figureTopImg + ')'; 
      upInMove=1;
      if(flagUp==0){
      flagUp=1;
      flagRight=0;
      rightInMove=0;
      flagDown=0;
      downInMove=0;
      flagLeft=0;
      leftInMove=0;
          try{
      clearInterval(timerDown);
      clearInterval(timerLeft);
      clearInterval(timerRight);
    }
    catch{}

      timerUp = setInterval(playerMoveUp,50);
    }
   
}

   // down
    else if(event.keyCode==83){
    figure.style.backgroundImage='url(' + figureDownImg + ')'; 
     downInMove=1;
     if(flagDown==0){
      flagDown=1;
      flagRight=0;
      rightInMove=0;
      flagLeft=0;
      leftInMove=0;
      flagUp=0;
      upInMove=0;
          try{
      clearInterval(timerUp);
      clearInterval(timerLeft);
      clearInterval(timerRight);
    }
    catch{}

      timerDown = setInterval(playerMoveDown,50);
    }
}

     // hit
    else if(event.keyCode==190){
     if (flagInHit==0) {
          flagInHit=1
          playerHit();
            }
    }

     // setGranade

    else if(event.keyCode==69){ 
    
     if(granadesCount>0){
      playerHitByGranade();
        }
    }
    
  // select weapon

  // 1 - arms
    else if(event.keyCode==49){
      selectArmAttack();
    }
  // 2 - pistol
    else if(event.keyCode==50){
      selectPistolAttack();
    }

  // 3 - shootgun
    else if(event.keyCode==51){
     selectShootgunAttack();
    }

  // 4 - plasmagun
    else if(event.keyCode==52){
     selectPlasmagunAttack();
    }

  // 5 - firegun
    else if(event.keyCode==53){
     selectFiregunAttack();
    }
   }
}

     // обаботчики нажатий на клавиши
window.onkeyup = function(){
    if(inTeleportation==0){ 

// shift
      if(event.keyCode==16){
      playerLeftXDistance=-7;
      playerRightXDistance=7;
      playerUpYDistance=7;
      playerDownYDistance=-7;   
    }

  // left
        if(event.keyCode==65){
          flagLeft=0;
          leftInMove=0;
          if((rightInMove==0) && (leftInMove==0) && (upInMove==0) && (downInMove==0) && (flagLeft==0) && (flagRight==0) && (flagUp==0) && (flagDown==0)){
          flagStayLeft=1;
      	  }
          clearInterval(timerLeft);
          changePlayerImgThenButtonUp();
       
}
  // right
    else if(event.keyCode==68){
          flagRight=0;
          rightInMove=0;
          if((rightInMove==0) && (leftInMove==0) && (upInMove==0) && (downInMove==0) && (flagLeft==0) && (flagRight==0) && (flagUp==0) && (flagDown==0)){
          flagStayRight=1;
          }
          clearInterval(timerRight);
          changePlayerImgThenButtonUp();
}
   // down
    else if(event.keyCode==83){
          flagDown=0;
          downInMove=0;
          if((rightInMove==0) && (leftInMove==0) && (upInMove==0) && (downInMove==0) && (flagLeft==0) && (flagRight==0) && (flagUp==0) && (flagDown==0)){
          flagStayRight=1;
      	  }
          clearInterval(timerDown);
          changePlayerImgThenButtonUp();
}
   // up
    else if(event.keyCode==87){
          flagUp=0;
          upInMove=0;
          if((rightInMove==0) && (leftInMove==0) && (upInMove==0) && (downInMove==0) && (flagLeft==0) && (flagRight==0) && (flagUp==0) && (flagDown==0)){
          flagStayRight=1;
          }
          clearInterval(timerUp);
          changePlayerImgThenButtonUp();
     
}
     // hit
    else if(event.keyCode==190){
      flagInHit=0;
    }
  }
}



